import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
  { id: "e1", title: "first event" },
  { id: "e2", title: "second event" },
];

export default function Events() {
  return (
    <>
      <h1>Events Page</h1>
      <ul>
        {DUMMY_EVENTS.map((event) => (
          <li key={event.id}>
            <Link to="">{event.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}
